[rewrite_local]
https://h5.ele.me/restapi/biz.growth_finetune/v1/finetune/operate? url script-request-header https://raw.githubusercontent.com/leafTheFish/DeathNote/main/elm.js
[MITM]
hostname = h5.ele.me

const $ = new Env("饿了么")
